import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {

  constructor(private service:RegisterService, private router: Router){}

  Add(name:any, email:any, phone:any, age:any){
    if (name && email && phone && age) { // Check if all required fields have data
      let newStudent = {name , email , phone, age};
      this.service.AddNewStudent(newStudent).subscribe();
      // Navigate to home component after adding the new student
      this.router.navigate(['/']);
    }
  }
}
